import React, { Component } from 'react';

class SectionHeading extends Component {
    render() {
        return(
            <h1 style={sectionHeading}><mark>{'<'}</mark> {this.props.heading} <mark>{'/>'}</mark></h1>
        )
    }
}

const sectionHeading = {
    marginBottom: '44px',
    position: 'relative',
}

export default SectionHeading;
